import React from 'react'

export default function Profile() {
  return (
    <div>
      <main
        className="main-content "
        style={{
          marginLeft: props.isExpanded
            ? window.innerWidth < 768
              ? "3rem"
              : "11.5rem"
            : window.innerWidth > 768
            ? "3rem"
            : "3rem",
        }}
      ><h1>This is profile</h1></main>
      
    </div>
  )
}
